D-SPORT DCAS（D-SPORT C-spec Adjustable Suspension）-Kitは、Bilstein製BSS-KitをベースにD-SPORTが独自のセッティングを施し、Bilstein製ショックアブソーバーの特長であるオイル容量の大きな大径チューブと前後の車高調整システムが、D-SPORTが考える理想のスポーツ走行を可能にします。減衰力固定式ながらストリートからサーキットまでをカバーできる高性能ショックアブソーバーを軸に、スプリングと車高の組み合わせ次第で、お好みのセッティングを自由に構築できます。<br><br>


ショックアブソーバー仕様 <br>
ストラット式サスペンションにおいて重要となる、ストラット部の剛性確保のため、倒立構造を採用。（フロント）<br>
単筒式ならではの大口径ピストンの採用で、微細な減衰力も安定かつ確実に発生します。（フロント／リヤ）
ケース長ストロークを変更しローダウン時のバウンドストロークを確保。（フロント／リヤ）<br>
サーキット仕様の推奨車高時に、バンプラバーを積極的に使用できるようバンプラバーをチューニング。（フロント）<br>
純正アッパーマウントを使用。（フロント）<br>
車高調整機構：［フロント］ネジ式車高調整／［リヤ］専用スプリングにより調整<br>
車高調整幅（エッセ用）：［フロント］－60～0mm／［リヤ］－25mm、－15mm<br><br>


スプリング仕様 <br>
引っ張り強度1720N/mmのSUP12材を採用し、長期間の使用でもヘタらない高い耐久性を確保。（フロント／リヤ）<br>
プログレッシブレートとすることで、優れた路面への追従性と乗り心地を確保。（リヤ）<br><br>

道路運行車両法適応部品。<br>
公道を走行する際は、必ず最低地上高90mm以上を確保してください。<br>
使用状況（走行場所、装備品、乗車人数、タイヤ・ホイールサイズ、車高設定値など）により、フェンダーと干渉する場合がりますのでご注意ください。<br>
